import React from 'react';
import "./App.css";
import Video from "./Video";
import danielle from './danielle.mp4';
function App() {
  return (
    //BEM naming convention
    <div className="app">
      <div className="app__videos">
      <Video vid={danielle}/>
      <Video />
    </div>
    </div>
  );
}

export default App;
